export const getAllNavigate = async () => {
  try {
    const response = await fetch("localhost:27017/newCollection");
    const body = await response.json();
    return body?.data;
  } catch (error) {
    console.error(error);
    return null;
  }
};

export const getAllProducts = () => {
  return fetch("http://localhost:3000/transport-products")
    .then((res) => res.json())
    .then((body) => body.products);
};

async function getData() {
  try {
    let res = await fetch("http://localhost:3000", {
      mode: "cors",
    });

    if (!res.ok) {
      console.log(res);
      throw new Error(res.statusText || res.status);
    }

    let data = await res.json();
    console.log(data);
  } catch (err) {
    console.error(err);
    alert("Произошла ошибка...");
  }
}
